import React from 'react';

const CarouselComponent = () => {
  return (
    <div className="w-full relative">
      <div className="carousel relative container mx-auto">
        <div className="carousel-inner relative overflow-hidden w-full">
          <input className="carousel-open" type="radio" id="carousel-1" name="carousel" aria-hidden="true" hidden defaultChecked />
          <div className="carousel-item absolute opacity-0" style={{ height: '60vh' }}>
            <img src="https://images.unsplash.com/photo-1497436072909-60f360e1d4b1?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2560&q=80" alt="image 1" className="block h-full w-full object-cover" />
          </div>
          <label htmlFor="carousel-3" className="carousel-control absolute cursor-pointer hidden h-10 w-10 md:block">
            <svg className="carousel-control-button text-white" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
              <polygon points="5 4 15 12 5 20 5 4"></polygon>
            </svg>
          </label>
        </div>
      </div>
    </div>
  );
};

export default CarouselComponent;
